def fasta(n):
	refList = ['-']*10000
	newSeq = ''
	tup = ()
	for position, id_snp in haploDictA.items():
		for i in range(len(refList)):
			if position - n == i: #for first 10kb
				for id in id_snp.keys():	
					refList[i] = id_snp[id]
					newSeq = "".join(list(refList))
					tup = (id, newSeq)
	return tup

